import React, { Component } from "react";
import { Link, useLocation} from "react-router-dom";
import "../style/Course.css";
import "../App.css";

//test
import contestList from "./test-data"; 

// import { Container, Form }from 'react-bootstrap'
// import 'bootstrap/dist/css/bootstrap.min.css'

export default class ViewContest extends Component {

  constructor(props){
    super(props);
    this.state = {
      value: this.props.location.state.contest,
      count : 0
    };
    this.location = this.location.bind(this)
  }
  
  location= () => {
    const location = useLocation();
  }

  render() {
    
    const openbtn = {
      border: "2px solid white",
      width: "13%",
      display: "flex",
      justifyContent: "center",
      alignItems: "center"
    }


    return (
      <>
        <br />
        <div className="firsthead">
          <h1 style={{ color: "darkslategray", display: "inline-block" }}>
            Contest{" "}
          </h1>
          <button value="Add Questions" id="rd_btn" >
            <Link to="/createContest" style={{ color: "darkslategray" }}>
              {"Add Questions"}
            </Link>{" "} 
          </button> 
        </div> <br/>

        <div className="practiceques">
        
        {
        contestList.map(contest => {
              return(
           
        <div className="Ques-box" style={{display:"flex"}}>
          <div className="Questions" id={this.state.count + 1} > 
             <div><p>{this.value.ContestID}</p></div>
            <div><p>{contest.ContestTitle}</p></div>
            <div><p>{contest.ContestStatus}</p></div>
          </div>
          <Link to={`/contest/ViewContest`} style={openbtn} >Open</Link>
        </div>
           )
          })
        }

        </div>
      </>
    );
  }
}
